            "job_description": "Position Summary...\n\nWhat you'll do...\n\nDiscover limitless career opportunities at Sam's Club, where our vibrant work culture fuels professional growth, encourages exploration of new challenges, and values your commitment to making a significant difference. As a proud division of the Fortune's #1 company, Walmart, Inc., we foster an inclusive environment where you can bring your unique self to work. A career at Sam's Club merges tackling the world's most complex challenges with a compassionate way of life. Our mission extends far beyond our club walls. Join us and experience why we are a global leader in diversity, inclusion, sustainability, and community involvement.\n\nAs a Full Stack Software Engineer III in Sam's Club Computer Vision team, you will be at the forefront of developing state-of-the-art, scalable, and resilient computer vision solutions aimed at providing a seamless shopping experience for our valued members by leveraging cutting-edge Artificial Intelligence (AI) technologies. Collaborating with cross-functional teams of software engineers and data scientists, you will drive the creation of innovative automation solutions to complex challenges in the field of computer vision. Your expertise will play a crucial role in scaling our platform with robust system observabilities, solidifying our standing as a team continuously pushing the industry's edge. Check out the press release to gain a better understanding of the exciting technology you will be working on.\n\nAbout Team: Sam's Club Computer Vision\nSam's Club is our membership warehouse club, a business model that provides our members with high-quality products at prices that are unrivaled by traditional retail. Sam's Club provides a carefully curated assortment of items, as well as developing and leading technologies and services such as Scan & Go, Exit Vision, and Club Pickup which elevate the convenience to a next level for our members. Sam's Club also provides travel, auto purchasing, pharmacy, optical, hearing aid centers, tire and battery centers, and a portfolio of business operations support services.\n\nWhat you'll do:\n• Collaborate with cross-functional teams to gather and understand software requirements and plan out deliverables.\n• Design, develop, and test robust and scalable software applications using various programming languages, frameworks, and technologies across cloud and distributed edge servers.\n• Utilize automated testing frameworks and CI/CD tools for software development and deployment.\n• Troubleshoot and debug software issues, providing timely resolutions.\n• Participate in code reviews, identify bugs, and suggest improvements to optimize performance and maintainability.\n• Collaborate with the team to continuously improve software development methodologies and practices.\n• Stay updated with emerging technologies and industry trends, recommending innovative solutions to improve software development processes.\n\nWhat you'll bring:\n• A bachelor's degree or higher in computer science with minimum of 2 years of industry experience in the software engineering or a related role.\n• Strong understanding of object-oriented programming principles and design patterns.\n• Proficiency in Python development and microservice architecture methodology using mainstream container solutions like Docker.\n• Experience in modern front-end frameworks (e.g., React, Angular, Vue) and other technologies such as HTML, CSS\n• Industrial experience with the cloud platforms and using corresponding resources, such as NoSQL DBs (e.g., Cosmos), messaging brokers, RESTful APIs, serverless Apps.\n• Proficiency in using version control tools and agile development methodologies.\n• Excellent communication and collaboration abilities.\n• Ability to work effectively in a fast-paced, team-oriented environment.\n\nAbout Walmart General/Not Function Specific\nSam Walton opened the first Sam's Club in 1983 to meet a growing need among customers who wanted to buy merchandise in bulk. Since then, Sam's Club has grown rapidly, opening more than 600 clubs in the U.S. and 100 clubs internationally. By offering affordable, wholesale merchandise to members, Sam's Club helps make saving simple for families and small business owners. Sam's Club employs about 110,000 associates in the U.S. The average club is 134,000 square feet and offers bulk groceries and general merchandise. Most clubs also have specialty services, such as a pharmacy, an optical department, a photo center, or a tire and battery center.\n\nFuture Ways of Working:\nOur company's success can be attributed to our employees. While technology has allowed us to be effective while working remotely, there is no substitute for being in the office together; it helps to shape our culture, collaborate, innovate, build relationships, and move more quickly. We strive to provide flexibility in order to promote a healthy work-life balance but recognize that in-person interactions are important to our culture and shared success. We'll meet in person on a regular and purposeful basis.\n\nBenefits:\nBenefits: Beyond our great compensation package, you can receive incentive awards for your performance. Other great perks include 401(k) match, stock purchase plan, paid maternity and parental leave, PTO, multiple health plans, and much more.\n\nEqual Opportunity Employer:\nSam's Club is an Equal Opportunity Employer- By Choice. We believe we are best equipped to help our associates, customers, and the communities we serve live better when we really know them. That means understanding, respecting, and valuing diversity- unique styles, experiences, identities, abilities, ideas and opinions- while being inclusive of all people.\n\nThe above information has been designed to indicate the general nature and level of work performed in the role. It is not designed to contain or be interpreted as a comprehensive inventory of all responsibilities and qualifications required of employees assigned to this job. The full Job Description can be made available as part of the hiring process.\n\nMinimum Qualifications...\n\nOutlined below are the required minimum qualifications for this position. If none are listed, there are no minimum qualifications.\n\nOption 1: Bachelor's degree in computer science, computer engineering, computer information systems, software engineering, or related area and 2 years' experience in software engineering or related area.Option 2: 4 years' experience in software engineering or related area.\n\nPreferred Qualifications...\n\nOutlined below are the optional preferred qualifications for this position. If none are listed, there are no preferred qualifications.\n\nCustomer Service\n\nMasters: Computer Science\n\nPrimary Location...\n603 MUNGER AVE STE 400, DALLAS, TX 75202, United States of America",
