            "job_description": "About Orchard\n\nOrchard is radically simplifying the way people buy and sell their homes. For the average American, the home purchase and sale process takes months, creates anxiety, and is filled with uncertainty and hassle. Orchard has reimagined the end-to-end experience of buying and selling, from innovative home search tools to find the perfect home to the ability to buy a new home before selling your current one.\n\nOrchard customers manage the entire experience through a personalized online dashboard, while also getting the support of best-in-class Orchard real estate agents.\n\nHeadquartered in New York City with an office in Austin and teammates across the US, Orchard has over 400 employees and growing. We have financing from top-tier investors including Revolution, Firstmark, Accomplice, Navitas and Juxtapose, who have also backed the likes of Pinterest, Airbnb, Shopify and Sweetgreen. We're proud to be recognized by Crain's, Inc. 5000, Glassdoor, Parity.org and Built In on their lists of best places to work.\n\nAbout the Role\n\nOrchard’s engineering culture is centered around product empathy and autonomous teams with high feature ownership. Engineers take ownership of feature development end to end. This means we partner with Product Managers and Designers to solve ambiguous business problems and have a high degree of collaborative input before writing code. We strive to keep common infrastructure and dependencies simple (or only as complex as necessary), to keep the coordination costs of infrastructure deployments low, and support lean & nimble product engineering teams.\n\nThis is an exciting opportunity to join a team at the ground floor, and play an instrumental role in making the home buying and selling experience frictionless for our customers. We’re looking for engineers that are passionate about building delightful customer experiences for both web and mobile, designing scalable architecture for our API platform & internal tools, and orchestrating data processing across different data sources.\n\nThe ideal candidate will have at least 1 year of experience creating, updating and maintaining web applications and/or backend services.\n\nThis is a full-time role that will report into the Director of Engineering with the option to be based in our NYC office or fully remote in any of the following states: AZ, CA, CO, CT, DC, FL, GA, MA, MD, NC, NJ, NY, OR, PA, SC, TN, TX, VA, WA, or WI.\n\nWhat You'll Do Here\n\nBuild and continuously deploy both internal tools and consumer facing products.\n\nWork with business stakeholders to design and architect solutions to our business problems.\n\nPlay an active role in mentoring other engineers.\n\nWe'd Love to Hear From You if You Have\n\nAt least 1 year of experience in software engineering.\n\nExperience with web stack languages (including Python/JavaScript/Java/C#) preferred; openness to learning and working in Python required.\n\nWorking knowledge of building web applications using single-page technologies and service-oriented architecture.\n\nExperience working with a team to plan, prioritize, build, and deploy code regularly using CI/CD tools.\n\nDemonstrated communication and interpersonal skills to work across diverse stakeholders and cross-functional teams.\n\nA low ego and can-do attitude; willingness to admit mistakes and work to remedy them.\n\nFamiliarity with AWS, Node, Postgres, SQL, Airflow, Docker, Circle\n\nCI a plus.\n\nFor NYC and Colorado residents only:\nThe pay range for this position in New York City and Colorado is $130,000-$150,000/year. The actual base pay offered may vary within the range provided depending on job-related knowledge, skills, experience, and location. Stock options and other incentive pay may be provided as part of the compensation package, in addition to a full range of medical, financial, and/or other benefits, depending on the position offered.\n\nThis information is provided per the New York City Human Rights Law and the Colorado Equal Pay Act. Please note that the range provided is applicable only to New York City-based and Colorado-based applicants. Base compensation may vary if the work location is outside of New York City or Colorado.\n\n#LI-AW1 #LI-Remote #BI-Remote Orchard is proud to be an equal opportunity employer. We provide employment opportunities without regard to age, race, color, ancestry, national origin, religion, disability, sex, gender identity or expression, sexual orientation, veteran status, or any other protected status in accordance with applicable law. #J-18808-Ljbffr",
